          <source
            src="/assets/goldcoins.mp4"
            type="video/mp4"
            allowFullScreen
          />
        </video>
        <div className='mask' style={{
          minHeight: "100vh", background:
            "linear-gradient(to bottom, rgba(4,22,57,0.6), rgba(11,34,117,0.6))"

